import  React  from "react";

class check extends React.Component{
    constructor()
    {
        super();
    }

    render(){
        return(
            <div className="col-xl-3 col-md-12">
              <div className="card" style={{height:"360px"}}>
                <div className="card-body">
                    <span>State with Highest Active Cases</span><br></br>
                    <span>State with Highest Recovered Cases</span><br></br>

                    <span>State with Highest Death Cases</span>

                </div>
              </div>
            </div>
        )
    }
}

export default check;
